import React from 'react';
import { Link } from 'react-router-dom';
import { Particles } from 'react-particles-js';

const Landing =() => {
    return (
        <div>
            <Particles 
            params={{ 
              particles: { 
                number: { 
                  value: 200, 
                  density: { 
                    enable: true, 
                    value_area: 1000, 
                  } 
                }, 
              }, 
            }} 
          > 
        <Link  to={`/join`} >
        <button type = "submit">Click here</button>
        </Link>
        </Particles>
        </div>
    );
}

export default Landing;
